import React, { useState, useEffect } from "react";

function Game({ username }) {
  const [score, setScore] = useState(0);
  const [steps, setSteps] = useState(0);
  const [gameData, setGameData] = useState(null);
  const [gameOver, setGameOver] = useState(false);
  const [message, setMessage] = useState(""); // Feedback message
  const [userInput, setUserInput] = useState(""); // User input for number
  const [clickedNumbers, setClickedNumbers] = useState([]); // Track clicked numbers

  useEffect(() => {
    fetchGame();
  }, []);

  const fetchGame = async () => {
    try {
      const response = await fetch(
        "http://localhost:8080/bananagame-1.0-SNAPSHOT/api/game"
      );
      const data = await response.json();
      setGameData(data);
      setMessage(""); // Reset message on new game load
    } catch (error) {
      console.error("Error fetching game data:", error);
    }
  };

  const handleInputChange = (event) => {
    setUserInput(event.target.value);
  };

  const handleAnswer = () => {
    const selectedNumber = parseInt(userInput);
    if (isNaN(selectedNumber) || selectedNumber < 0 || selectedNumber > 9) {
      setMessage("Please enter a valid number between 0 and 9.");
      return;
    }

    setSteps(steps + 1);
    setClickedNumbers([...clickedNumbers, selectedNumber]);

    if (selectedNumber === gameData.solution) {
      setScore(score + 1);
      setMessage(`Correct! You answered in ${steps + 1} steps.`);
      setGameOver(true);
    } else {
      setMessage("Wrong answer. Try again!");
    }

    setUserInput(""); // Clear input field after submission
  };

  const playAgain = () => {
    setSteps(0);
    setScore(0);
    setGameOver(false);
    setMessage(""); // Clear the message
    setUserInput(""); // Clear input field
    setClickedNumbers([]); // Reset clicked numbers
    fetchGame();
  };

  return (
    <div className="game-container flex flex-col items-center p-6 bg-gray-50 shadow-xl rounded-lg max-w-lg mx-auto mt-10">
      {gameData && (
        <>
          <h1 className="text-3xl font-semibold mb-6 text-center text-indigo-600">
            Welcome, {username}!
          </h1>

          {/* Game Image */}
          <div className="w-full h-64 mb-6 rounded-lg overflow-hidden shadow-lg">
            <img
              src={`data:image/png;base64,${gameData.imageBase64}`}
              alt="Banana game puzzle"
              className="w-full h-full object-cover rounded-lg"
            />
          </div>

          {/* Feedback Message */}
          {message && (
            <div className="toast-message text-center mb-4 p-2 bg-indigo-600 text-white rounded-lg shadow-md">
              <p>{message}</p>
            </div>
          )}

          {/* Input Field for Answer */}
          {!gameOver && (
            <div className="mb-4 w-3 flex flex-col items-center">
              <input
                type="number"
                value={userInput}
                onChange={handleInputChange}
                className="p-3 rounded-lg border-2 border-blue-500 mb-4 text-center w-24"
                placeholder="Enter number"
                min="0"
                max="9"
              />
              <button
                onClick={handleAnswer}
                className="bg-blue-500 text-white p-4 rounded-lg shadow-md hover:bg-blue-600 transition duration-300"
              >
                Submit Answer
              </button>
            </div>
          )}

          {/* Game Over Message */}
          {gameOver && (
            <div className="text-center mb-6">
              <p className="text-lg text-green-600 mb-4">
                You answered correctly in {steps} steps!
              </p>
              <button
                onClick={playAgain}
                className="bg-green-500 text-white p-4 rounded-lg shadow-md hover:bg-green-600 transition duration-300"
              >
                Play Again
              </button>
            </div>
          )}

          {/* List of Clicked Numbers */}
          <div className="mt-6">
            <h2 className="text-xl font-semibold">Numbers You Clicked:</h2>
            <div className="flex justify-center mt-2">
              {clickedNumbers.length > 0 ? (
                clickedNumbers.map((num, index) => (
                  <span
                    key={index}
                    className="bg-blue-300 text-white p-2 rounded-lg mx-2"
                  >
                    {num}
                  </span>
                ))
              ) : (
                <p>No numbers clicked yet.</p>
              )}
            </div>
          </div>
        </>
      )}
    </div>
  );
}

export default Game;
